css:
.github-PrSelectionByBranch {
  flex: 1;
  display: flex;
  overflow: auto;
}
.github-PrSelectionByBranch-container {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-PrSelectionByBranch-message {
  padding: 0 10px;
  margin: 10px 0;
}
.github-PrSelectionByBranch-input {
  padding: 0 10px;
  margin: 10px 0;
}
.github-PrSelectionByBranch-input .github-PrUrlInputBox-Subview > input {
  margin-top: 0;
}
.github-PrSelectionByBranch-list {
  list-style: none;
  padding-left: 0;
  cursor: default;
}
.github-PrSelectionByBranch-list li {
  padding: 5px 10px;
  border-top: 1px solid #d8d8d8;
}
.github-PrSelectionByBranch-list li:hover {
  background-color: #e3e3e3;
}
